@import url(https://fonts.googleapis.com/css?family=Poppins:100,100italic,200,200italic,300,300italic,regular,italic,500,500italic,600,600italic,700,700italic,800,800italic,900,900italic);

* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
  font-family: "Poppins", sans-serif;
}

body {
  position: relative; 
  min-height: 100vh;
  margin: 0;
  display: flex;
  align-items: center;
  justify-content: center;
  background: url('./images/background10.jpg') center/cover no-repeat; 
}

.container {
  position: relative;
  width: 100%;
  max-width: 400px;
  padding: 30px;
  overflow: hidden;
  border-radius: 10px;
  box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
  background-color: rgba(246, 246, 246, 0.289);
  backdrop-filter: blur(50px);
  box-shadow: 0 0 10px rgba(255, 255, 255, 0.2), 0 0 0 4px rgba(255, 255, 255, 0.2);
}

.heading {
  text-align: center;
  font-size: 40px;
  color: white;
  margin-bottom: 50px;
  text-shadow: 1px 1px 2px rgba(0, 0, 0, 0.5);
}

label {
  display: block;
  font-size: 12px;
  margin-bottom: 10px;
  color: white;
  text-shadow: 1px 1px 2px rgba(0, 0, 0, 0.5);
}

select {
  width: 100%;
  padding: 10px;
  border: none;
  text-transform: capitalize;
  border-radius: 5px;
  margin-bottom: 20px;
  background: white;
  font-size: 14px;
}

.start-screen .btn {
  margin-top: 50px;
}

.hide {
  display: none;
}

.timer {
  width: 100%;
  height: 40px;
  display: flex;
  align-items: center;
  justify-content: center;
  flex-direction: column;
  margin-bottom: 30px;
}

.timer .progress {
  position: relative;
  width: 100%;
  height: 40px;
  background: transparent;
  border-radius: 30px;
  overflow: hidden;
  margin-bottom: 10px;
  border: 3px solid rgba(255, 255, 255, 0.2);
}

.timer .progress .progress-bar {
  width: 100%;
  height: 100%;
  border-radius: 30px;
  overflow: hidden;
  background: linear-gradient(45deg, hsl(25, 98%, 79%), hsl(337, 100%, 50%));
  transition: 1s linear;
}

.timer .progress .progress-text {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  color: white;
  font-size: 16px;
  font-weight: 500;
}

.question-wrapper .number {
  color: hsl(338, 78%, 48%);
  font-size: 25px;
  font-weight: 500;
  margin-bottom: 20px;
}

.question-wrapper .number .total {
  color: hsl(338, 78%, 48%);
  font-size: 20px;
}

.question-wrapper .question {
  color: white;
  font-size: 20px;
  font-weight: 500;
  margin-bottom: 20px;
  text-shadow: 1px 1px 2px rgba(0, 0, 0, 0.5)
}

.answer-wrapper .answer {
  width: 100%;
  height: 60px;
  padding: 20px;
  border-radius: 10px;
  color: white;
  border: 3px solid rgba(255, 255, 255, 0.2);
  display: flex;
  align-items: center;
  justify-content: space-between;
  margin-bottom: 20px;
  cursor: pointer;
  transition: 0.3s linear;
  text-shadow: 1px 1px 2px rgba(0, 0, 0, 0.2)
}

.answer .checkbox {
  width: 20px;
  height: 20px;
  border-radius: 50%;
  border: 3px solid hsl(338, 78%, 48%);
  display: flex;
  align-items: center;
  justify-content: center;
  transition: all 0.3s;
}

.answer .checkbox i {
  color: white;
  font-size: 10px;
  opacity: 0;
  transition: all 0.3s;
}

.answer:hover:not(.checked) .checkbox,
.answer.selected .checkbox {
  background-color: hsl(338, 78%, 48%);
  border-color: hsl(338, 78%, 48%);
}

.answer.selected .checkbox i {
  opacity: 1;
}

.answer.correct {
    border-color: hsl(128, 90%, 49%);
}

.answer.wrong {
  border-color: hsl(0, 97%, 61%);
}

.question-wrapper,
.answer-wrapper {
  margin-bottom: 50px;
}

.btn {
  width: 100%;
  height: 60px;
  background: linear-gradient(45deg, hsl(342, 100%, 64%), hsl(342, 70%, 48%));
  box-shadow: 0 0 10px rgba(255, 255, 255, 0.2), 0 0 0 4px rgba(255, 255, 255, 0.2);
  border: none;
  border-radius: 10px;
  color: white;
  font-size: 18px;
  font-weight: 500;
  cursor: pointer;
  transition: 0.3s linear;
}

.btn:hover {
 background: linear-gradient(45deg, hsl(25, 98%, 79%), hsl(337, 100%, 50%));
}

.btn:disabled {
  background: linear-gradient(45deg, hsl(342, 100%, 64%), hsl(342, 70%, 48%));
  cursor: not-allowed;
}

.btn.next {
  display: none;
}

.end-screen .score {
  color: white;
  font-size: 25px;
  font-weight: 500;
  margin-bottom: 80px;
  text-align: center;
}

.score .score-text {
  color: hsl(338, 78%, 48%);
  font-size: 16px;
  font-weight: 500;
  margin-bottom: 120px;
}

/* PRELOADER */
:root {
  --loading-text-gradient: linear-gradient(90deg, transparent 0% 16.66%, hsl(0, 0%, 20%) 33.33% 50%, transparent 66.66% 75%);
  --gradient-1: linear-gradient(to top, hsla(0, 0%, 0%, 0.9), hsla(0, 0%, 0%, 0.7), transparent);
  --preload-background: linear-gradient(45deg, hsl(25, 98%, 79%), hsl(337, 100%, 50%));
  --white: hsl(0, 0%, 100%);
  --smoky-black-3: hsl(0, 0%, 100%);
  --radius-circle: 50%;
  --transition-1: opacity 0.5s ease;
  --transition-2: transform 0.5s ease, visibility 0.5s ease;
  --weight-bold: bold;
  --eerie-black-3: hsl(0, 0%, 0%);
  --gray-text: hsl(0, 13%, 81%); 
}

.preload {
  position: fixed;
  top: 0; 
  left: 0;
  right: 0;
  bottom: 0;
  background: var(--preload-background);
  z-index: 10;
  display: grid;
  place-content: center;
  justify-items: center;
  transition: var(--transition-2);
}

.preload>* { 
  transition: var(--transition-1);
}

.preload.loaded>* { 
  opacity: 0;
}

.preload.loaded { 
  transition-delay: 250ms;
  transform: translateY(100%);
}

.circle {
  width: 112px;
  height: 112px;
  border-radius: var(--radius-circle);
  border: 3px solid var(--white);
  border-block-start-color: var(--smoky-black-3);
  margin-block-end: 45px;
  animation: rotate360 1s linear infinite;
}

@keyframes rotate360 { 
  0% {
    transform: rotate(0);
  }

  100% {
    transform: rotate(1turn);
  }
}

.preload .text {
  background-image: var(--loading-text-gradient);
  background-size: 500%;
  font-size: calc(2rem + 3vw);
  font-weight: var(--weight-bold);
  line-height: 1em;
  text-transform: uppercase;
  letter-spacing: 16px;
  padding-inline-start: 16px; 
  -webkit-text-fill-color: var(--gray-text); 
  background-clip: text;
  -webkit-background-clip: text;
  -webkit-text-stroke: 0.5px var(--eerie-black-3);
  animation: loadingText linear 2s infinite;
}

@keyframes loadingText { 
  0% {
    background-position: 100%;
  }

  100% {
    background-position: 0%;
  }
}

@keyframes spin {
  0% {
    transform: rotate(0deg);
  }
  100% {
    transform: rotate(360deg);
  }
}

.preload.hidden {
  opacity: 0;
  visibility: hidden;
}

/*SETTINGS*/

/*MOBILE*/
@media (max-width: 767px) {
    .header {
        font-size: 16px;
    }
}

/*LAPTOP*/
@media (min-width: 768px) {
    .header {
        font-size: 24px;
    }
}
